    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T23:05:19.181376",nt"name": "patterns-of-habitat-selection-and-densities-of-white-tailed-deer-on-and-around-quivira-nat",nt"isopen":
    false,nt"url": null,nt"notes": "This report is on  a project conducted
    to provide additional analysis of GPS and VHF data that was initially collected
    from white-tailed deer at Quivira National Wildlife Refuge (QNWR) between 2007 u2013
    2009. The primary objectives of the additional analysis were to: 1) assess patterns
    of habitat selection by male deer in response to specific crop types and prescribed
    fires, and 2) to assess temporal variation in patterns of private land-use by both
    male and female white-tailed deer, particularly in relation to the hunting season.
    In addition, continued distance-sampling surveys were conducted during both 2010
    and 2011 and results of these surveys were analyzed and compared to previous data
    collected on QNWR from 2007-2009. The current project successfully completed these
    objectives and the following report should provide useful information relevant to
    management of the white-tailed deer population at QNWR. In addition, with the documented
    occurrence of CWD in Stafford County from a deer harvested during the 2011 hunting
    season, the combined data from this report and Blecha et al. (2010) should provide
    important information about conditions prior to CWD arrival and can also be used
    to inform management decisions designed to mitigate CWD spread on and around the
    refuge.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
